import React from 'react';
import { MDBBtn, MDBIcon } from 'mdb-react-ui-kit';

function NavBar() {
    return (
        <>
            <div className="navBar">
                <span className="aboutMe">Sobre Mim</span>
                <a href="#projects">Projetos</a>
                <div className="socialMedia">
                    <span>Contato:</span>
                    <MDBBtn tag='a' color='none' className='m-1' style={{ color: '#f0c505' }}
                    href="https://facebook.com/rmaxn" target="_blank">
                        <MDBIcon fab icon='facebook-f' size='lg' />
                    </MDBBtn>

                    <MDBBtn tag='a' color='none' className='m-1' style={{ color: '#f0c505' }}
                    href="https://twitter.com/rMaXn" target="_blank">
                        <MDBIcon fab icon='twitter' size='lg' />
                    </MDBBtn>

                    <MDBBtn tag='a' color='none' className='m-1' style={{ color: '#f0c505' }}
                    href="mailto:robertson.nunes@gmail.com" target="_blank">
                        <MDBIcon fab icon='google' size='lg' />
                    </MDBBtn>

                    <MDBBtn tag='a' color='none' className='m-1' style={{ color: '#f0c505' }}
                    href="https://instagram.com/rmaxn" target="blank">
                        <MDBIcon fab icon='instagram' size='lg' />
                    </MDBBtn>
                </div>
            </div>
        </>
    )
}

export default NavBar
